Alterations to previous p.p. 04-AP-2348: 18 additional dwellings in building fronting Abbey St for total 3x studios, 35x 1-bed, 30x 2-bed, 8x 3-bed flats + balconies; also elevational changes to bldng on Tower Bridge Rrd + cycle store. Prev perm = Redevelopment of New Caledonian antiques market to provide three new buildings; two of which are positioned around a central public square: 

Building A (facing Tower Bridge Road and Abbey Street) - part six, part eight and part ten storey building  comprising a mix of retail (Class A1), offices (Class B1), arts/leisure, cafe/restaurant uses (Class A3) and 56 flats on upper floors;

Building B (facing Bermondsey Street): seven storeys with market store and cafe/restaurant (Class A3) on ground and first floors with hotel on upper floors and roof top bar ; 

Building C (facing Long Walk): part three and part four storeys comprising 14 flats; and Provision of landscaped public square to accommodate 200 market stalls.

REDEVELOPMENT OF FORMER PLAYING FIELDS SITE FOR 
(A) RESIDENTIAL DEVELOPMENT (CLASS C3), WITH 3 x BUILDINGS OF BETWEEN THREE & FOUR STOREYS COMPRISING 169 NEW DWELLINGS AND CREATION OF LANDSCAPED AREAS AND RECONFIGURED VEHICULAR & PEDESTRIAN ACCESS, TOGETHER WITH ASSOCIATED WORKS INCLUDING CAR PARKING, CIRCULATION SPACE AND PLANT AREAS;
(B) PROVISION OF A LANDSCAPED PUBLIC OPEN SPACE WITH ASSOCIATED WORKS.

Outline application for the demolition of existing college buildings, removal of hardsurfacing, site clearance and groundworks together with the redevelopment of the site to provide: 
1) A new campus for education and enterprise purposes, comprising; Replacement College (Use Class D1) of up to 16,000sqm to accommodate up to 3,000 FTE day time students, as well as evening and weekend use; A Science, Technology, Engineering and Maths (STEM) Centre (D1 Use Class) of up to 6,100sqm;
2) A new Secondary School (D1 Use Class) of up to 7,000 sqm for up to 750 students;
3) A new Special Educational Needs (SEN) School (D1 Use Class) of up to 4,000sqm for up to 115 students;
4) A new ancillary 'Technical Hub' for Haymarket Media (B1 Use Class) of up to 1,700sqm;
5) Replacement on-site sports centre (D2 Use Class) of up to 3,900sqm to serve both the college, schools and wider community;
6) The upgrading of existing Craneford Way playing fields for use by the college, schools and local community;
7) Alterations to existing means of access for vehicles, pedestrians and cyclists from the A316 involving the creation of a signalised junction, alterations to the A316 footbridge and minor realignment of Langhorn Drive, alterations of existing vehicular access points on Egerton Road as well as the upgrading of Marsh Farm Lane footpath;
8) Provision of on-site parking (non-residential) for up to 230 vehicles, open space and landscaping, and
9) A new residential development of up to 180 units together with associated parking for up to 190 vehicles, open space and landscaping.

